create or replace view VW_TOTAL_MOVEMENT as
SELECT row_number() OVER (ORDER BY 1) ID, C.BRANCH_ID, CSE.CASH_ID, MOV.DATE, MOV.CASH_START_END_ID, MOVEMENT_ID, "SOURCE", PAYMENT_METHOD,CARD,round( CAST( TOTAL as numeric), 2) total
FROM CASH_START_END CSE
JOIN (
	SELECT SS.DATE,SS.CASH_START_END_ID, SS.MOVEMENT_ID,"SOURCE", SS.PAYMENT_METHOD, SS.CARD, SUM(SS.SUB_TOTAL) TOTAL
	FROM
	(
	select
		date_trunc('day', DATE_TIME) DATE,
		CASH_START_END_ID,
		MOVEMENT_ID,
		CASE WHEN source_id=1 THEN 'Venta Online' ELSE 'Venta Local' end "SOURCE",
		PM.DESCRIPTION PAYMENT_METHOD,
		coalesce (C.NAME ,null,'No Aplica',C.NAME) CARD,
		SUB_TOTAL
	FROM
		CASH_MOVEMENT CM
	JOIN SALE_PAYMENT SP ON
		CM.TRANSACTION_ID = SP.SALE_ID
	LEFT JOIN PAYMENT_METHOD PM ON
		SP.PAYMENT_METHOD_ID = PM.ID
	LEFT JOIN CARD C ON
		 SP.CARD_ID= C.ID

	UNION ALL
	SELECT date_trunc('day',DATE_TIME) DATE,CASH_START_END_ID,MOVEMENT_ID,'Mov. de Caja' "SOURCE",  'Efectivo' PAYMENT_METHOD,'No Aplica' CARD, AMOUNT SUB_TOTAL  FROM CASH_MOVEMENT CM
	 WHERE CM.SOURCE_ID not in (2,1)
	) as SS
GROUP BY DATE,CASH_START_END_ID, MOVEMENT_ID,"SOURCE", PAYMENT_METHOD, CARD) as MOV
ON MOV.CASH_START_END_ID=CSE.ID
JOIN CASH C
ON C.ID=CSE.CASH_ID
order by CASH_START_END_ID, PAYMENT_METHOD, CARD,"SOURCE",MOVEMENT_ID desc;

